import logo from './logo.svg';
import { Welcome } from "./components/findmusictogether"
import './App.css';

function App() {
  return (
    <div className="App">
      <Welcome name="mr steven" />
      <SomeText />
      <SomeText />
      <SomeText />
    </div>
  );
}

function SomeText() {
  return <p>hello, this is some text!</p>
}

export default App;
